SELECT vlunitario, COUNT(vlunitario) AS quantidade
FROM tbdetempenho
GROUP BY vlunitario
HAVING quantidade > 1
ORDER BY quantidade DESC;

SELECT vlunitario, COUNT(vlunitario) AS quantidade
FROM tbdetempenho
GROUP BY vlunitario
HAVING quantidade = 3
ORDER BY vlunitario;

select count(*), vlunitario from tbdetempenho group by vlunitario having count(*)=3;

SELECT COUNT(*), vlunitario 
FROM tbdetempenho 
GROUP BY vlunitario 
HAVING COUNT(*) = 3 
ORDER BY vlunitario;

select descricao from tbdetempenho where vlunitario between 10.00 and 11.00;

select descricao from tbdetempenho where vlunitario in(10.00, 15.00, 20.00)
select count(*), vlunitario from tbdetempenho group by vlunitario;

select descricao from tbdetempenho where descricao like '%papel%';

select *from tbempresas order by razaosocial asc;

select *from tbempresas limit 5;

select *from tbempresas order by razaosocial asc limit 5,3;

select tbempenho.descricao from tbempenhos, tbempresas, tbdetemepenho where tbempresas.razaosocial = "R. M. CAMPOS DE OLIVEIRA' and tbempresas.cnpj = tbempenhos.cnpj and tbempenhos.ne = tbdetempenho.ne;

SELECT tbdetempenho.descricao 
FROM tbempenhos, tbempresas, tbdetempenho 
WHERE tbempresas.razaosocial = 'R. M. CAMPOS DE OLIVEIRA' 
AND tbempresas.cnpj = tbempenhos.cnpj 
AND tbempenhos.ne = tbdetempenho.ne;

select tbemp.cnpj from tbempenhos tbem, tbempenhos tbemp where tbem.cnpj = '41492604000180' and tbem.data = tbemp.data;

SELECT tbempresas.razaosocial
FROM tbempresas
LEFT JOIN tbempenhos ON tbempresas.cnpj = tbempenhos.cnpj
WHERE tbempenhos.cnpj IS NULL;

select tbempenhos.cnpj from tbempresas right join tbempenhos on tbempenhos.cnpj=tbempresas.cnpj where tbempresas.cnpj is null;

